function get_ous(ou) {
    var options = {
        'url': 'https://dhis.hisptz.org/dev/api/organisationUnits/'+ ou + '.json?fields=id,name,children[id,name]',
        'headers': headers
    };

    return new Promise(function (resolve, reject) {
        request.get(options, function (err, res, body) {
            if (err) {
                reject(err);
            } else {
                resolve(JSON.parse(body));
            }
        })
    })
}

function promiseBasedPost(data) {
    try {
        axios({
            'method': 'post',
            'url':'https://dhis.hisptz.org/dev/api/events?orgUnitIdScheme=code',
            'data': data,
            'headers': headers
        }).then(function (response) {
            console.log(JSON.stringify(response));
        });
    } catch (e) {
        console.log('error', e)
    }
}

function postData(data) {
    var promise = new Promise(function (reject, resolve) {
        request.post({
            'headers': headers,
            'url': 'https://dhis.hisptz.org/dev/api/events?orgUnitIdScheme=code',
            'json': JSON.parse(data)
        }, function (error, response, body) {
            if (!error && response.statusCode == 200) {
                var object = JSON.parse(body);
                console.log(object);
                resolve(object);
            } else {
                if (response) {
                    console.log(response.statusCode + ":", JSON.stringify(error));
                    reject();
                } else {
                    console.log(response);
                }
            }
        });
    });

    promise.then(function (res) {
        console.log(res)
        return true;
    })
}

